body {
  font-size: 12px;
  padding-bottom: 60px;
}

.nav__barre {
  display: flex;
  z-index: 2;
  width: 100%;
  position: fixed;
  bottom: 0px;
}
.nav__barre nav {
  width: 100%;
  z-index: 10;
  background-color: black;
  height: 52px;
  padding-top: 15px;
}
.nav__barre nav img {
  transition: transform 500ms;
  display: block;
  height: 23px;
  margin: auto auto auto auto;
  z-index: 10;
  transition-timing-function: linear;
}
.nav__barre nav img.active {
  transform: translateY(-140px);
}
.nav__barre nav ul {
  position: absolute;
}
.nav__barre nav ul li {
  width: 42px;
  height: 3px;
  background-color: white;
  margin: 5px 0px 5px 20px;
}
.nav__barre .nav_hidden {
  background-color: #2B2B2B;
  position: fixed;
  bottom: 0px;
  width: 100%;
  z-index: 1;
  color: white;
  font-size: 18px;
  text-align: center;
  transition: transform 500ms;
  transform: translateY(67px);
  transition-timing-function: linear;
}
.nav__barre .nav_hidden.active {
  transform: translateY(-67px);
}
